import React from 'react';
import { useParams } from 'react-router-dom';

function Item() {
  const { id } = useParams();

  const itemData = fetchDataFromApi(id);

  return (
    <div className="Item">
      <h2>Item {id}</h2>
      <p>Status: {itemData.status}</p>
      <p>Description: {itemData.description}</p>
    </div>
  );
}

export default Item;
